<div class="container p-4">
  <h2>Land Price Prediction</h2>

  <form #predictForm="ngForm" (ngSubmit)="onSubmit(predictForm)">
    <!-- Year input -->
    <div class="mb-3">
      <label for="year" class="form-label">Year</label>
      <input
        type="number"
        id="year"
        name="year"
        class="form-control"
        required
        [(ngModel)]="year"
        #yearCtrl="ngModel"
      />
      <div *ngIf="yearCtrl.invalid && (yearCtrl.dirty || yearCtrl.touched)" class="text-danger">
        Year is required.
      </div>
    </div>

    <!-- State (encoded) input -->
    <div class="mb-3">
      <label for="state" class="form-label">State (encoded)</label>
      <input
        type="number"
        id="state"
        name="state"
        class="form-control"
        required
        [(ngModel)]="stateEncoded"
        #stateCtrl="ngModel"
      />
      <div *ngIf="stateCtrl.invalid && (stateCtrl.dirty || stateCtrl.touched)" class="text-danger">
        State encoding is required.
      </div>
    </div>

    <!-- Land Use (encoded) input -->
    <div class="mb-3">
      <label for="landUse" class="form-label">Land Use (encoded)</label>
      <input
        type="number"
        id="landUse"
        name="landUse"
        class="form-control"
        required
        [(ngModel)]="landUseEncoded"
        #landUseCtrl="ngModel"
      />
      <div *ngIf="landUseCtrl.invalid && (landUseCtrl.dirty || landUseCtrl.touched)" class="text-danger">
        Land-use encoding is required.
      </div>
    </div>

    <!-- Submit button -->
    <button
      type="submit"
      class="btn btn-success"
      [disabled]="predictForm.invalid || predicting"
    >
      {{ predicting ? 'Predicting...' : 'Predict Price' }}
    </button>
  </form>

  <!-- Results display -->
  <div *ngIf="predictedUSD !== null" class="alert alert-success mt-4">
    <p>
      <strong>Price (USD/m²):</strong>
      {{ predictedUSD | number:'1.2-2' }}
    </p>
    <p *ngIf="predictedTND !== null">
      <strong>Price (TND/m²):</strong>
      {{ predictedTND | number:'1.2-2' }}
    </p>
  </div>

  <!-- Error fallback -->
  <div *ngIf="!predicting && predictedUSD === null && predictForm.submitted" class="alert alert-danger mt-4">
    Prediction failed. Please check your inputs and try again.
  </div>
</div>
